import React from 'react';
import './App.css';
import Mapa from './mapa';
import data from './tooltip-datasource.json'
import bajar from './imgs/flecha.gif';
import { Button } from '@material-ui/core';
import RateReviewIcon from '@material-ui/icons/RateReview';
export class App extends React.Component {

  constructor(props, context) {
    super(props, context);

    this.state = {
    };
    this.mapRef = React.createRef();
  }

  convert(){
var m = data;
m.forEach(function(p){
       p.value1= `${p.value1}`;
});
  }


  render(){
    this.convert();
    return (
      <div className="App">
        <header className="App-header">
          <div className="App-header-back">
            <p className="App-header-title">Felicidad Mundial</p>
            <img className="App-header-bajar" src={bajar}></img>
          </div>
        </header>
        <div className="App-mapa">
          <p className="App-info">Datos de felicidad en el mundo del a√±o anterior</p>
          <Mapa className='App-map'></Mapa>
          <Button
            variant="contained"
            color="default"
            // className={classes.button}
            startIcon={<RateReviewIcon></RateReviewIcon>}
          >
            Ver Storytelling
          </Button>
        </div>
      </div>
    );
    }
}

export default App;
